import React, { Component } from 'react';
import { myModels, myFavoriteModels, searchAllModels } from './services/apiService';
import Card from './components/card/card';
import 'materialize-css/dist/css/materialize.min.css';
import './App.css';

class App extends Component {
    constructor() {
        super();
        this.state = {
            isLoaded: false,
            models: {
                cursors: {},
                next: undefined,
                previous: null,
                results: []
            }
        };
    }
    componentDidMount() {
        myModels()
            .then((myModelsResponse) => {
                console.log(myModelsResponse);
                this.setState({
                    isLoaded: true,
                    models: myModelsResponse
                });
            })
    }
    displayMyFavoriteModels() {
        this.setState({
            isLoaded: false,
        });
        myFavoriteModels()
            .then((myFavoritesResponse) => {
                // console.log(myFavoritesResponse);
                this.setState({
                    isLoaded: true,
                    models: myModelsResponse
                });
            })
    }
    displayModelsSearch() {
        this.setState({
            isLoaded: false,
        });
        searchAllModels()
            .then((searchResponse) => {
                // console.log(searchResponse);
                this.setState({
                    isLoaded: true,
                    models: myModelsResponse
                });
            });
    }
    render() {
        const { isLoaded, models } = this.state;
        return (
            <div className="app-container">
                <div className="navigation">
                    <div className="auth">
                        <i className="small material-icons">person</i>
                        <span>Welcome, aabarata</span>
                    </div>
                </div>
                <div className="divider"></div>
                {
                    models.results.length > 0 && isLoaded
                        ? (
                            <div className="gallery">
                                <div className="card-list row">
                                    {models.results.map(result => (
                                        <Card key={result.uid} model={result}></Card>
                                    ))}
                                </div>
                            </div>
                        )
                        : !isLoaded
                            ? (<div className="loading">Loading...</div>)
                            : (<div className="placeholder">The search didn't returned any model.</div>)
                }
            </div>
        );
    }
}

export default App;
